CREATE TABLE [Planets] 
(
	[id]	uniqueidentifier,
    [name]	VARCHAR(512),
    [rotation_period]	VARCHAR(512),
    [orbital_period]	VARCHAR(512),
    [diameter]	VARCHAR(512),
    [climate]	VARCHAR(512),
    [gravity]	VARCHAR(512),
    [terrain]	VARCHAR(512),
    [surface_water]	VARCHAR(512),
    [population]	VARCHAR(512),
    [residents]	VARCHAR(512),
    [films]	VARCHAR(512),
    [created]	VARCHAR(512),
    [edited]	VARCHAR(512),
    [url]	VARCHAR(512)
);

